INSERT INTO `message` (`message_id`, `message_guid`, `title`, `description`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, '59271abd54c484.04804229', 'جایزه به مناسبت ورژن دوم برنامه', 'به مناسبت ارتقا برنامه به ورژن دوم به همه ی بازیکنان 50 فندق جایزه داده می شود. باشد که رستگار شوید', '2017-06-03 00:00:00', '2017-06-03 00:00:00', NULL),
(2, '59271abd24c484.04806229', 'تخفیف ویژه فروش فندق', '20 درصد تخفیف ویژه فروش فندق به مناسبت دهه فجر. بدو بیا که تموم نشه . فرصت محدود می باشد', '2017-06-03 00:00:00', '2017-06-03 00:00:00', NULL),
(3, '59271abd34c424.04806229', 'جایزه به مناسبت تولد شما', 'تبریک! تعداد 200 فندق بابت تولدتان به شما تعلق گرفت.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(4, '59271abd34c424.04806223', 'جایزه بابت ورود شماره موبایل', 'تبریک! تعداد 500 فندق بابت ورود شماره موبایلتان به شما تعلق گرفت.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(5, '59271abd54c484.04804229', 'جایزه بابت دعوت دوستان', 'کاربر گرامی 1500 فندق بابت دعوت از دوستتان به شما تعلق گرفت .', '2017-06-03 00:00:00', '2017-06-03 00:00:00', NULL),
(6, '59271abd54c484.04804229', 'جایزه بابت ثبت نام با کد دعوت', 'کاربر گرامی 500 فندق بابت ثبت نام با کد دعت دوستتان به شما تعلق گرفت .', '2017-06-03 00:00:00', '2017-06-03 00:00:00', NULL),
(7, '59271abd54c484.04804229', 'تولدت مبارک', 'کاربر گرامی 1000 فندق برای تولدتان به شما تعلق گرفت', '2017-06-13 00:00:00', '2017-06-03 00:00:00', NULL),
(8, '59271abd54c484.04802229', 'خوش اومدی', 'سلام، به لاکی لرد خوش اومدی!! سوال جواب بده و مسابقه بده و فندق و شانس ببر و در قرعه کشی ها شرکت کن و جوایز نفیس برنده شو!!!', '2017-08-01 00:00:00', '2017-08-18 00:00:00', NULL),
(9, '59271abd54b484.04802229', 'درخواست رمز عبور جدید', 'کاربر گرامی شما به ما درخواست تغییر رمز دادید و ما لینکی به ایمیل شما ارسال کردیم که با کلیک روی اون رمز شما به رمز جدید تغییر پیدا میکنه. درصورتی که این درخواست از جانب شما نبوده میتوانید این پیام رو نادیده بگیرید.', '2017-08-09 00:00:00', '2017-08-31 00:00:00', NULL),
(10, '59271abd54ا484.04804229', 'ثبت نام', 'دوست عزیز اگه ثبت نام کنی علاوه بر این که فندق بیشتری گیرت میاد اکانتتم ایمن کردی', '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(11, '59271abd54ا484.04805229', 'پیام شما دریافت شد', 'دوست عزیز پیام شما دریافت شد. ما همچنان در حال کار روی گسترش بازی هستیم. از صبر و شکیبایی شما سپاسگزاریم.', '2017-11-25 00:00:00', '2017-11-25 00:00:00', NULL),
(12, '59271abd54ا484.04805229', 'آموزش بازی', 'کاربر گرامی ، هدف بازی اینه که شما با جواب دادن به سوالا و شرکت در مسابقات و به دست آوردن شانس علاوه بر افزایش اطلاعات عمومیتون، احتمال برنده شدن در قرعه کشی ها رو برای خودتون زیاد کنید. برای شرکت در قرعه کشی ها به قسمت مربوطه برید', '2017-11-25 00:00:00', '2017-11-25 00:00:00', NULL),
(13, '59271abd54ا484.04805229', 'پاسخ به سوال بازی با دوستان', 'کاربر گرامی ، در حال حاضر امکان بازی با فرد خاص وجود ندارد و ما در حال توسعه این بازی هستیم تا این امکان فراهم شود . شما میتوانید فعلا به صورت تصادفی با دیگران مسابقه داده ', '2017-11-25 00:00:00', '2017-11-25 00:00:00', NULL);
