(12, '59221175933392.74190651', 10, '	\r\nیک سوم مجموع دو عدد مثبت مساوی تفاضل آنهاست. در این صورت:', 'عدد بزرگتر ۲ برابر عدد کوچکتر است*#	عدد بزرگتر ۳ برابر عدد کوچکتر است#	عدد بزرگتر ۴ برابر عدد کوچکتر است#	عدد بزرگتر ۵/۱ برابر عدد کوچکتر است', 250, 1, 1, 7, 14, 0, 0, '2017-05-25 00:00:00', '2017-05-25 00:00:00', NULL),
